import React from 'react';
import NavBar from '../common/components/NavBar';

function HomePage() {
  const authToken = localStorage.getItem('token');
  return (
    <div>
      <NavBar /><br /><br /><br />
      <h1 style={{textAlign: 'center'}}>Wineries IL</h1>
    </div>
  );
}

export default HomePage;



function PersonalZonePage() {
  const authToken = localStorage.getItem('token');
  // console.log('authToken:', localStorage.getItem('token'));
  // console.log('authToken:', localStorage.getItem('user-name'));
   return (
     <>
     <NavBar authToken={authToken} /><br /><br /><br />
     <h1 style={{textAlign: 'center'}}>Wineries IL</h1>
     {authToken ? (
       <>
       <h1 style={{textAlign: 'center'}}>Personal Zone</h1> 
       </>
       ) : ( 
         <p style={{textAlign: 'center'}} >Please log in to access this content.</p>
         )}
     </>
   );
}
